<script id="csinit" type="text/x-cindyscript">
//KETlib
//230507
use("KetCindyPlugin");
Dircdy=loaddirectory;
setdirectory(gethome());
import("ketcindy.ini");

xx=-8;
Text34.xy=[xx,4.2];
Text9.xy=[xx,2.8];//Make taskline
Text0.xy=[xx,1.4];//Taskline>>Kettask
Text10.xy=[xx,0];// Make scoreline
Text11.xy=[xx,-1.4];// Scoreline>>Ketscore
Text4.xy=[xx,-2.8];// Maxima
Text3.xy=[xx,-4.2];// Make Card
Text5.xy=[xx,-5.6];// Make combine
Text7.xy=[xx,-7];// Line,Txt to Csv
Text8.xy=[xx,-8.4];// Make combine
Text33.xy=[xx,-9.8];
Text32.xy=[-2,-11.2];// ans check
Text31.xy=[xx,-11.2];// mxans
Text16.xy=[xx,-11.2];// mxans
//Text13.xy=[xx+1,5.8];// 実行
Text6.xy=[xx+4,5.8];// リセット
//Text2.xy=[-4.8,-10];
//Text6.xy=[-2.3,-10];
//Text13.xy=[-6.3,-10];


posxy0=[8,-5.5];
posxy=posxy0;
mp=[-10,-10];
size=["Size=1.2"];
clr=size;
clrb=append(size,"Color=blue");
clrr=append(size,"Color=red");

Sortsel(fLorg,key):=(
  regional(fL,tmp,tmp1,tmp2,head,tail,nL,out);
  fL=fLorg;
  tmp=length(key);
  if(tmp>0,
    fL=select(fLorg,substring(#,0,tmp)==key);
  );
  tmp1=indexof(fL_1,"-");
  head=substring(fL_1,0,tmp1);
  nL=[];
  forall(fL,
    tmp2=indexof(#,".");
    if(tmp2>0,
      tail=substring(#,tmp2-1,length(#));
      tmp=substring(#,length(head),tmp2-1);
    ,
      tail="";
      tmp=substring(#,tmp1,length(#));
    );      
    nL=append(nL,parse(tmp));
  );
  nL=sort(nL);
  out=apply(nL,head+#+tail);
  out;
);

Initscreen():=(
  Px=7.5;Py=6;
  xL=[73];
  yL=apply(1..15,10);
  Tabledata("1",xL,yL,[],
     [0,"Setwin=n","Move=[-1,-10]","Msg=n"]);
  mv=[-1,-10];
);


Resetsetting():=(
  pngflg=0;
  dispL=[];
  fselectL=[];
  origin="";
);


Remark(Px,str):=Remark(Px,str,"black");
Remark(Px,str,clr):=(
  //global Py
  Letter([Px,Py],"e",str,["Size=1.2","Color="+clr]);
  Py=Py-1;
);

Tablepos(tb,mv):=(
  regional(tmp,tmp1,tmp2,cl,rw);
  //global mp:mouse().xy, Dirdata
  tmp1=apply(tb_1,#_1+mv_1);
  tmp2=apply(tb_2,#_2+mv_2);
  cl=0;
  if((mp_1>tmp1_1)&(mp_1<tmp1_(-1)),
    tmp=select(1..(length(tmp1)),tmp1_#>mp_1);
    cl=tmp_1-1;
  );
  rw=0;
  if((mp_2<tmp2_1)&(mp_2>tmp2_(-1)),
    tmp=select(1..(length(tmp2)),tmp2_#<mp_2);
    rw=tmp_(1)-1;
  );
  [cl,rw];
);

MakefileL(dfL):=(
  regional(out,tmp,dir,selectL,fL,se,s);
  out=[];
  forall(1..(length(dfL)/2),nn,
    dir=dfL_(2*nn-1);
    tmp=dfL_(2*nn);
    if(!islist(tmp),tmp=[tmp]);
    selectL=apply(tmp,Strsplit(#,"*"));
    fL=Filelist(dir);
    fL=sort(fL);
    forall(selectL,se,
      tmp=fL;
      forall(se,s,
        tmp=select(tmp,indexof(#,s)>0);
      );
      out=concat(out,tmp);
    );
  );
  out;
);

Selectfile(out):=Selectfile(out,100);
Selectfile(out,Arg):=(
  if(isstring(Arg),
    Selectfile(out,100,Arg);
  ,
    Selectfile(out,Arg,"black");
  );
);
Selectfile(out,num,clr):=(
  regional(nblu,nblk,cl,rw,outd,tmp,tmp1,res);
  //global mp:mouse().xy
  outd=[];
  if(!islist(num),
    tmp=max([1,num]);
    nblu=tmp..(length(out));
  ,
    nblu=num;
  );
  nblk=remove(1..(length(out)),nblu);
  if(islist(num),numL=num,numL=1..num);
  if(numL==[0],numL=[]);
  forall(out,
    tmp=Indexall(#,".");
    if(length(tmp)>0,
      tmp=tmp_(-1);
      tmp1=substring(#,0,tmp-1);
    ,
      tmp1=#;
    );
    outd=append(outd,tmp1);
  );
  tmp=min([length(out),15]);
  tmp1=1..tmp;
  if(length(tmp1)>0,
    forall(nblu,
      Putcell(1,#,"l2",outd_#,["Color=blue"]);
    );
    forall(nblk,
      Putcell(1,#,"l2",outd_#,["Color="+clr]);
    );
    tmp=Tablepos(tb1,mv);
    cl=tmp_1; rw=tmp_2;
    if((cl*rw>0)&(rw<=length(out)),
      res=[rw,out_rw];
    ,
      res=[0,""];
    );
  ,
    res=[0,""];
  );
  res;
);


;

</script>
<script id="cskeytyped" type="text/x-cindyscript">

kL=keydownlist();
if(length(kL)>0,
  if(kL==[17,70], //Ctr+f (Figures)
    Viewtex();
    kc();
  );
  if(kL==[16,17,80], //Ctr+Shift+p (Parent)
    if(length(Shellparent)>0,
      Makeshell(),Makebat();
    );
    WritetoSci(2);
    kc();
  );
  if(kL==[17,74], //Ctr+j (Ketjsoff)
    Mkketcindyjs(append(KETJSOP,"Web=n"));
  );
  if(kL==[16,17,74], //Ctr+Shift+j (Ketjson)
    Mkketcindyjs(append(KETJSOP,"Web=yj"));
  );
);
;

</script>

;

<script id="csdraw" type="text/x-cindyscript">
//figures
Ketinit();
Addax(0);
Setwindow([-8.3,6.7],[-11.5,5.8]);

Initscreen();

pngflg=1;
if(pngflg==1,
  Resetsetting();
  //HTMLに書き出しておく
  filein=Namecdy+".html";
  data=Readlines(Dircdy,filein);
  dline=select(1..(length(data)),
         indexof(data_#,"data:image")>0);
println(dline);

if(1==0,
  tmp=dline_(-1);
  tmp1=data_tmp;
  fname=Fhead+"png.txt";
  fid=openfile(fname);
    println(fid,data_tmp);
  closefile(fid);
);
  pngflg=0;
);

posxy=posxy0;
forall(disp0L,
  Letter(posxy,"e",#_1,#_2);
  posxy=posxy-[0,1];
);

forall(dispL,
  if(islist(#_1),
    Letter(posxy,"e",#_1_1+"...",#_2);
  ,
    Letter(posxy,"e",#_1,#_2);
  );
  posxy=posxy-[0,1];
);

Windispg();

;

</script>
